'Refid format'=>'Format ID Polecającego (Referral ID)',
'It is possible to use following values in ID: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be copied to refid as you will specify in format. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'Możliwe jest wykorzystanie następujących wartości ID: {9} - zostanie zastąpiony przez dowolny znak w przedziale [0-9] {z} - zostanie zastąpiony przez dowolny znak w przedziale [a-z] {Z} - zostanie zastąpiony przez dowolny znak w przedziale [ A-Z] {X} - zostanie zastąpiony przez dowolny znak z przedziału [0-9a-zA-Z]. Wszystkie inne znaki pozostaną bez zmian. Przykład prawidłowego zapisu to. {ZZZ} - {XXXXX} - {999}',
'Refid format saved'=>'Zapisano format ID Polecającego (Referral ID)',
'Refid must be in format "%s". Format definition: {9} - will be replaced by any character in range [0-9], {z} - will be replaced by any character in range [a-z], {Z} - will be replaced by any character in range [A-Z], {X} - will be replaced by any character in range [0-9a-zA-Z], all other characters will be unchanged. Example of good format is e.g. {ZZZ}-{XXXXX}-{999}'=>'ID Polecającego (Referral ID) musi być w formacie "% s". Definicja formatu: {9} - zostanie zastąpiony przez dowolny znak w przedziale [0-9] {z} - zostanie zastąpiony przez dowolny znak w przedziale [a-z] {Z} - zostanie zastąpiony przez dowolny znak w przedziale [ A-Z] {X} - zostanie zastąpiony przez dowolny znak z przedziału [0-9a-zA-Z]. Wszystkie inne znaki pozostaną bez zmian. Przykład prawidłowego zapisu to. {ZZZ} - {XXXXX} - {999}',
'Custom refid'=>'Niestandardowy ID Polecającego (Referral ID)',
